// frontend/src/pages/AdminDashboard.js
import { useEffect, useState } from "react";
import axios from "axios";
import { API_BASE } from "../config";
import "../AppStyles.css"; // Ensure this path is correct

function AdminDashboard() {
  const [payments, setPayments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchPayments = async () => {
      try {
        // Ensure this URL is correct: /api/admin/payments
        const res = await axios.get(`${API_BASE}/api/admin/payments`, {
          headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
        });

        // Data is coming from the backend, so it will be an array
        setPayments(res.data);

      } catch (err) {
        // Log error to console for detailed inspection
        console.error("Error fetching payments:", err);
        setError(err.response?.data?.msg || "Failed to fetch payments");
      } finally {
        setLoading(false);
      }
    };

    fetchPayments();
  }, []); // Empty dependency array means it runs only on mount

  return (
    <div className="page-container light-theme">
      <div className="clean-card" style={{ width: "90%", maxWidth: "1000px" }}>
        <h2 className="title">All Payments (Admin View)</h2>

        {loading && <p>Loading payments...</p>}
        {error && <p style={{ color: "red" }}>{error}</p>}
        {!loading && payments.length === 0 && <p>No payments found.</p>}

        {payments.length > 0 && (
          <table className="payments-table">
            <thead>
              <tr>
                <th>User Name</th>
                <th>Account #</th>
                <th>Amount</th>
                <th>Currency</th>
                <th>Payee Account</th>
                <th>SWIFT Code</th>
                <th>Status</th>
                <th>Date</th>
              </tr>
            </thead>
            <tbody>
              {payments.map((p) => (
                <tr key={p._id}>
                  {/* Use optional chaining (?) for safe access */}
                  <td>{p.userId?.fullName}</td> 
                  <td>{p.userId?.accountNumber}</td>
                  <td>{p.amount}</td>
                  <td>{p.currency}</td>
                  <td>{p.payeeAccount}</td>
                  <td>{p.swiftCode}</td>
                  <td>{p.status}</td>
                  <td>{new Date(p.createdAt).toLocaleString()}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default AdminDashboard;
